import classes from './Navbar.module.css';

const Navbar = (props) => {

    let level1 = <div className={classes.inActive}>1</div>
    let bar = <div className={classes.bar}>/</div>
    return (
        <div>
            {level1}
            {bar}
        </div>
    )
}

export default Navbar;
